import './AddBook.css'

function AddBook(props) {
    function handleChangeId(event) {
        props.setId(event.target.value);
    }

    function handleChangeTitle(event) {
        props.setTitle(event.target.value);
    }

    function handleChangeAuthor(event) {
        props.setAuthor(event.target.value);
    }

    function handleChangePrice(event) {
        props.setPrice(event.target.value);
    }
    
    return (
        <div className="form-container">
            <form className='form-div' onSubmit={props.handleSubmit}>
                <span >  Id: <input type="text" id='textId' onChange={handleChangeId} /></span>
                <span> Title: <input type="text" id='textTitle' onChange={handleChangeTitle} /></span>
                <span> Author: <input type="text" id='textAuthor' onChange={handleChangeAuthor} /></span>
                <span>  Price: <input type="text" id='textPrice' onChange={handleChangePrice} /></span>
                <input type="submit" value="Add" id='btnAdd' />
            </form>
        </div>
    )
}

export default AddBook
